<h1>【梦见保险杠】</h1>

                                <p><p>　　新手梦见汽车保险杠，新手焦虑症。</p><p>人人都有。</p><p> 　　梦见自己开车把别人的车后保险杠刮下来了，被同事或朋友牵连，财名皆失。</p><p> 　　梦见汽车保险杠，现实中，自己的意见或观点伤害了周围的人或是合作伙伴，表示梦者的成熟的心态，开始发现了自己的不足，向成功迈进的表现。</p></p>
